import React from 'react';

import { Pill } from './global';
import {Button} from 'antd';
import {
  CardContainer,
  Cover,
  CardContent,
  Avatar,
  Subtitle,
  ApplyButton,
  LinkWrapper,
} from './style';

const EventCard = ({
  primaryColor,
  avatar,
  title,
  location,
  dates,
  href,
  inactive,
  ...other
}) => (
  <LinkWrapper href={href}>
    <CardContainer inactive={inactive} data-tip={href} {...other}>
      <Cover color={primaryColor} />
      <CardContent>
        <Avatar fluid={avatar} alt={title + 'logo'} />
        <h3>{title}</h3>
        <Subtitle>{location}</Subtitle>
        <Button type="primary" shape="round" icon="download" size={large}>
          Download
          </Button>
        {/* <Pill stretch appearance={inactive ? 'secondary' : 'primary'}>
          {dates}
        </Pill> */}
        <ApplyButton stretch >
          Apply Now
        </ApplyButton>
      </CardContent>
    </CardContainer>
  </LinkWrapper>
);

export default EventCard;
